import React, { useState,useEffect } from "react";
import { useNavigate } from "react-router-dom"
import "./Cstore.css";

const CStore = ()=>{

  const navigate = useNavigate();
   const teens=()=>{
    navigate("/teens")
   }
   const comic=()=>{
    navigate("/comic")
   }
   const kids=()=>{
    navigate("/kids")
   }
   const kodesh=()=>{
    navigate("/kodesh")
   }
    return(
       <>
       <button onClick={(e)=>teens()}>Teens</button>
       <button onClick={(e)=>comic()}>Comic</button>
       <button onClick={(e)=>kids()}>Kids</button>
       <button onClick={(e)=>teens()}>Kodesh</button>
       </>
     
    );

}
export default CStore;
